import React, { useState, useEffect } from "react";
import { Route, Routes, useLocation } from "react-router-dom";
import Navbar from "./components/View/Navbar";
import Footer from "./components/View/Footer";
import Musicians from "./components/View/Musicians";
import Dashboard from "./components/Dashboard/Dashboard";
import ArtistDetail from "./components/View/ArtistDetail";
import Favorites from "./components/View/Favorites";
import Venues from "./components/View/Venues";
import VenueDetail from "./components/View/VenueDetail";
import Unauthorized from "./components/Dashboard/Unauthorized";
import { AuthProvider } from "./context/AuthContext";
import Jobs from "./components/View/Jobs";
import About from "./components/View/About";
import Login from "./components/Dashboard/Login";
import MusicStore from "./components/View/MusicStore";
import StoreDetail from "./components/View/StoreDetail";
import WeddingVIP from "./components/View/WeddingVIP";
import WeddingVIPDetail from "./components/View/WeddingVipDetail";
import Comingsoon from "./components/View/ComingSoon";
import Preloader from "./components/View/Preloader"; // Import Preloader
import "./App.css";
import "./index.css";

const App = () => {
  const location = useLocation();
  const [loading, setLoading] = useState(true);

  // Simulate loading
  useEffect(() => {
    setLoading(true); // Start loading when the location changes
    const timer = setTimeout(() => setLoading(false), 2000); // Adjust duration as needed
    return () => clearTimeout(timer);
  }, [location]);

  // Define paths where Navbar should not appear
  const hideNavigationOn = ["/"];
  const shouldShowNavigation = !hideNavigationOn.includes(location.pathname);

  return (
    <AuthProvider>
      <div className="App">
        {/* Preloader */}
        {loading && <Preloader />}

        {/* Full content rendering during loading */}
        <div style={{ visibility: loading ? "visible" : "visible" }}>
          {/* Navbar */}
          {shouldShowNavigation && <Navbar />}

          {/* Routes */}
          <Routes>
            <Route path="/" element={shouldShowNavigation && <Comingsoon />} />
            <Route path="/musician" element={ shouldShowNavigation && <Musicians />} />
            <Route path="/login" element={<Login />} />
            <Route path="/db-sarim-shehran1214" element={<Dashboard />} />
            <Route path="/unauthorized" element={<Unauthorized />} />
            <Route path="/artist/:id" element={shouldShowNavigation && <ArtistDetail />} />
            <Route path="/favorites" element={ shouldShowNavigation && <Favorites />} />
            <Route path="/venues" element={shouldShowNavigation && <Venues />} />
            <Route path="/wedding-vip-packages" element={shouldShowNavigation && <WeddingVIP />} />
            <Route path="/venuedetail/:id" element={shouldShowNavigation && <VenueDetail />} />
            <Route path="/music-store/:id" element={shouldShowNavigation && <StoreDetail />} />
            <Route path="/wedding-vip-packages/:id" element={shouldShowNavigation && <WeddingVIPDetail />} />
            <Route path="/jobs" element={<Jobs />} />
            <Route path="/about" element={<About />} />
            <Route path="/music-store" element={<MusicStore />} />
          </Routes>

          {/* Footer */}
          <Footer />
        </div>
      </div>
    </AuthProvider>
  );
};

export default App;
